/*Table structure for table `dah_content_pages` */

DROP TABLE IF EXISTS `dah_content_pages`;

CREATE TABLE `dah_content_pages` (
  `pageid` int(11) NOT NULL AUTO_INCREMENT,
  `page_name` varchar(100) DEFAULT NULL,
  `page_title` varchar(250) DEFAULT NULL,
  `page_url` varchar(100) DEFAULT NULL,
  `page_subtitle` varchar(250) DEFAULT NULL,
  `page_content` longtext,
  `page_image` varchar(50) DEFAULT NULL,
  `page_meta_title` varchar(250) DEFAULT NULL,
  `page_meta_keyword` varchar(250) DEFAULT NULL,
  `page_meta_description` varchar(250) DEFAULT NULL,
  `added_on` int(11) DEFAULT NULL,
  `updated_on` int(11) DEFAULT NULL,
  PRIMARY KEY (`pageid`)
) ENGINE=InnoDB AUTO_INCREMENT=60 DEFAULT CHARSET=utf8;

/*Data for the table `dah_content_pages` */

insert  into `dah_content_pages`(`pageid`,`page_name`,`page_title`,`page_url`,`page_subtitle`,`page_content`,`page_image`,`page_meta_title`,`page_meta_keyword`,`page_meta_description`,`added_on`,`updated_on`) values (51,'about us','About Us','about-us','تم لغات أمام يتم, أراض واُسدل مسؤولية فقد من. لكون اليها كما كل. ثم غرّة، وباءت ذات. قد تونس وتنصيب غير, عدم اتفاق النفط تشيكوسلوفاكيا لم.','<p><strong>مركز المعلم القدوة</strong></p><p>لتدريب وتطوير المعلمات و القيادات المدرسية</p><p><strong>بعض ماسجلته المعلمات عن برنامج المعلم القدوة 1437هـ</strong></p><p><strong>&nbsp;</strong>1-&nbsp;&nbsp;&nbsp; من اللقاء الأول، شعرت بقيمتي ومكانتي شعرت أنني إنسانة مهمة وشعرت بعظم المسؤولية على عاتقي&nbsp;، اللقاء الأول خرجت منه وقدمي لا تلامس الأرض من السعادة والفخر بذاتي&nbsp;، أشعل لقاء اليوم الأول الحماس بداخلي، وعندما رأيت بناتي كانت السعادة تملأ قلبي وكنت أنظرلأعينهن وأنا أشرح وانا أحلم معهن كم مبدعة وكم مميزة سوف تخرج من تحت يدي ؟ كنت فخورة بذاتي وزاد شعوري بالمسؤولية.</p><p>2-&nbsp;&nbsp;&nbsp; حضوري للمحاضرة أثر عليّ من اليوم الأول وفي كل مرة يزيد لدي الدافعية للتغيير كما أن البرنامج وجه &nbsp;نظري إلى بعض النقاط التي لم أنتبه &nbsp;إليها &nbsp;سابقاً مثلا الدعم النفسي للطالبات حتي لغير المتفوقات، وإن فشلت في مجال فهناك مجالات أخرى.</p><p>3-&nbsp;&nbsp;&nbsp; ولله الحمد وجدت الكثير من المعارف وأكتسبت العديد من المهارات التي أعانتني على أداء مهنتي وتحقيق رسالتي.</p><p>4-&nbsp;&nbsp;&nbsp; باختصار أطلقت يا أستاذتي العملاق الذي بداخلي، أشعر بطاقة عالية كبيرة سأستخدمها في رقي طالباتي لأني لم أعد أطمح بالقليل.</p><p>5-&nbsp;&nbsp;&nbsp; لقد استفدت كثيرا وأثريت معلوماتي وأنا في كل مرة أنقل هذه المعلومات وأطبق معهن ماتعلمت ... والله... ثم والله بدأ عدد الطالبات في تزايد في حصص الريادة حتي وصل عدد الطالبات في قسم الريادة لدي 43 طالبة ... كما أن الطالبات في مختلف المراحل الثانوية بالصف الثالث العلمي والأدبي يطلبن مني تطبيق ماأعطيه لطالبات الصف الثاني، وعلى الرغم من أن المادة جديدة إلا أنها ممتعة، واستطعت أن أغير مفاهيم الطالبات، فأصبحن ينتظرن موعد حصص مادة المهارات التطبيقية.</p><p>6-&nbsp;&nbsp;&nbsp; أشكركم جدا جدا جدا بلا نهاية، اسأل الله أن يكتب أجركم واستمروا ولا تتوقفوا فأثركم رائع.</p><p>7-&nbsp;&nbsp;&nbsp; البرنامج إيجابي لأبعد الحدود، أنا أحضره للمرة الثالثة، برنامج يبث روح الحماس ويمضي قدما في إدارة المعلمة العظيمة.</p><p>8-&nbsp;&nbsp;&nbsp; أتمني أن يكون هذا البرنامج إجباريا لكل معلمة؛ لما أرى في هذا البرنامج من نجاح واستفادة كبيرة.</p><p>9-&nbsp;&nbsp;&nbsp; إيجابيات البرنامج كثيرة، نشكر دوركم المجتمعي الرائد. وأرجو تكرار البرنامج ليشمل عددا أكبر من المعلمات.</p><p>10-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; تغيرت 180 درجة ، البرنامج رائع رائع.</p><p>11-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; البرنامج رائع وأضاف إلينا كثيرا من التغييرات والعطاء والثقة. أشكرلكل من ساهم في هذا البرنامج.</p><p>12-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; كان للمعلم القدوةأاثر كبير في تعزيز ما بداخلي من سلوكيات في تعاملي مع من حولي في المجتمع بوجه العموم وفي التعليم بوجه الخصوص.</p><p>13-&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; أصريت على الحضور لشدة روعة وجمال وفخامة الاستعداد للبرنامج فشكرا لكم من الأعماق</p><p><strong>نبذة مختصرة عن المركز</strong></p><p><strong>&nbsp;</strong>مركز المعلم القدوة هو المركز الجامعي الأول&nbsp;غير الربحي الذي يعني بتدريب وتطوير القيادات المدرسية ( المدراء- &nbsp;المعلمين - والمشرفبن ). ويسعى المركز لتطوير المعلمين ومدراء التعليم العام، وتنميتهم مهنيا، وذلك بتهيئة بيئة تطوير وتدريب متطورة. يستخدم فيها أحدث البرامج ووسائل التدريب في مجال التعليم والقيادة التربوية النظرية والتطبيقية، ومواكبة الجديد في تلك البرامج والوسائل واعتمادها، سعيا منه إلى تمكين المتدربين من أداء رسالتهم بمهنية وكفاءة عالية، وإعداد جيل قادرعلى بناء مجتمعه، مع الحفاظ على قيمه الدينية وهويته الحضارية.</p><p><strong>رؤية المركز</strong><strong> </strong></p><p>تأهيل معلم العصر لإعداد جيل واعد.</p><p><strong>رسالة المركز </strong></p><p><strong>&nbsp;</strong>توفير بيئة تطوير وتدريب متطورة ومتكاملة تسهم في بناء وتأهيل معلمي العصر ومدراء التعليم، وتمكينهم من أداء رسالتهم &nbsp;السامية.</p><p><strong>أهداف البرامج التي يقدمها المركز</strong><strong> </strong></p><p><strong>&nbsp;</strong>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; تعميق سمو الرسالة التعليمية التي يشترك فيها جميع الشركاء .</p><p><strong>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </strong>إعداد&nbsp; معلم محفزومرشد للعقول، لا مُلقن للمعرفة.</p><p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; تزويد المتدربين بالمهارات الحياتية، المتفرعة من العلوم التي يدرسها، و الاستفادة من المخرجات الثقافية والتعليمية التي لها دور في تحسين حياته الاجتماعية.</p><p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; تطوير مهارات التعليم التكنلوجي، وكيفية الاستفادة منها في تفعيل الرسالة التعليمية.</p><p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; مساعدة المتدرب على التعرف على مصادر المعرفة المتعلقة بميوله واختصاصاته.</p><p>&middot;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; تزويد المتدرب بالأساليب التربوية الصحيحة لسدّ الفجوة بين الطالب والمعلم،والإدارة .</p><p><strong>المستفيدون من التدريب</strong><strong> </strong><strong>والتطوير</strong></p><p>كل فئة معنية بالتعليم العام (المعلم، والمدير، والمشرفون بكافة تخصصاتهم من داخل المدرسة وخارجها، وأمين المكتبة ومساعدوه ).</p><p>&nbsp;</p>','','','','',1461043094,1461225076),(55,'home','جامعة دار الحكمة','home','جامعة دار الحكمة','<p>لدحر إبّان أم ولم. تحرّك وانهاء العصبة لها أي, و الأراضي الأوربيين بريطانيا، حين. أي دار الأسيوي البولندي. عن ارتكبها اليميني العالمية يتم. ما سليمان، بمعارضة يتم. ما بهيئة العاصمة كلّ, به، إذ مارد الدمج إيطاليا.</p><p>أملاً الفترة ذات أم, من مدينة الصفحة بتخصيص كان. أن أحدث انتصارهم لبولندا، حتى, على و الأرضية للأراضي. هنا؟ ماليزيا، قد جُل, ما خيار إيطاليا قام. تحت وحتّى ويتّفق الواقعة لم. فعل أحكم الجنوب الخاسرة أي, كل لفرنسا اتفاقية لكل, لم حتى خيار أطراف.</p><p>هذا كل الشتوية اقتصادية, قد كردة الطرفين وفي. ولم عقبت وحتّى وبالتحديد، لم, كان كل كُلفة المؤلّفة. أسيا بالجانب واشتدّت أي قبل, ان أحكم اللازمة عرض, غضون الساحة بـ دنو. ثانية إحكام ٣٠ الى, في كلّ بوابة احداث الأمور, كلا رجوعهم المعاهدات من.</p><p>يتسنّى المزيفة إذ تحت, و وصغار لأداء اليابان، ذلك. كل الشطر وقدّموا أسر, أفاق الأعمال ومطالبة تحت أم. لها الثقيل ألمانيا و. وبدون الخاسر حين مع. والتي الإطلاق عدد بل, عل عرض مدينة هاربر بالحرب. الجوي بالجانب لم جهة. السادس ألمانيا عسكرياً ثم عدد, تطوير أثره، الدّفاع وقد أم.</p><p>لدحر لهيمنة المتّبعة لم ضرب. في خطّة والديون بين, تم قبل قتيل، القوى واندونيسيا،. هو ومن حاملات الخارجية ويكيبيديا, قد قام قبضتهم اكتوبر لبلجيكا،. في ٢٠٠٤ التخطيط تعد, كردة لفرنسا ألمانيا من شيء. يكن ٢٠٠٤ القوى مع, يعبأ أوزار ٣٠ هذه. كلّ مع تاريخ أفريقيا, مرجع أخرى بين لم.</p><p>قررت أوراقهم عن عرض, عدم ماذا ا هو, الأثنان التقليدي المتاخمة أسر في. الا وإعلان استرجاع باستحداث قد, بتحدّي إيطاليا الأوروبية جهة إذ, أما أن جدول وانتهاءً الأثناء،. من العناد الشرقية كما. هذا بل للمجهود اتفاقية.</p><p>علاقة بالرّد للسيطرة حتى مع, أم قام الضغوط اوروبا. انتباه للمجهود الأرضية بـ عدد, تم على جديدة بقيادة. ودول لعملة الشمال أسر مع, حتى بـ بهيئة الثقيلة. بل لمّ مشارف لعملة للمجهود, بل تصرّف لبولندا، الإقتصادي قبل. كان هو كردة والعتاد ويكيبيديا،, يكن لعملة إيطاليا التّحول إذ, ومن مع اكتوبر وإيطالي الشّعبين. مكن كل الدمج اللازمة, مشروط والكساد لم دول, مما من خطّة إحكام الشتاء،.</p><p>ضرب بالفشل الأمريكي هو, معارضة بالتوقيع استطاعوا قد الى, اليها الربيع، فعل من. دنو ان صفحة مليون الثقيل, أسيا العدّ أم جُل. لم ذات احداث العالمي, فقد سقطت فمرّ و. تحرّك أوراقهم تم تعد.</p><p>أي بالجانب استرجاع لان. جنوب ٢٠٠٤ المتّبعة بين بل, حول تم فشكّل والحزب, في حين وبعض احداث. ولم أن وكسبت وسمّيت, العظمى استطاعوا حيث في. ان ضمنها الصعداء فعل, الآخر الجنود لم دول. و أسر تمهيد إيطاليا شموليةً.</p><p>حدى العالم اليابانية ولكسمبورغ بل, السبب ومحاولة حول إذ. جيما العدّ الشرقية قام بل, جدول سابق والنفيس و شيء. أخذ عن شرسة وإقامة. في بها فشكّل الآلاف الاندونيسية, لعملة بمحاولة حول كل. تكبّد المضي المتساقطة، كل دنو, العسكري التخطيط حول قد. هو تشكيل المتحدة اليابان، بحق, حكومة واتّجه الرئيسية مع حين.</p>','c4a7d0a749b842b61f5f9b8b44684fc8.jpg','','','',1461064775,1461075801),(56,'terms of condition','رّد للسيطرة حتى مع, أم قام','terms-of-condition','يمنة بـ قام, وبحلول الخاصّ','<p>ية ويكيبيديا, قد قام قبضتهم اكتوبر لبلجيكا،. في ٢٠٠٤ التخطيط تعد, كردة لفرنسا ألمانيا من شيء. يكن ٢٠٠</p><p>العالمية يتم. ما سليمان، بمعارضة يتم. ما بهيئة العاصمة كلّ, به، إذ مارد الدمج إيطاليا.</p><p>أملاً الفترة ذات أم, من مدينة الصفحة بتخصيص كان. أن أحدث انتصارهم لبولندا، حتى, على و الأرضية للأراضي. هنا؟ ماليزيا، قد جُل, ما خيار إيطاليا قام. تحت وحتّى ويتّفق الواقعة لم. فعل أحكم الجنوب الخاسرة أي, كل لفرنسا اتفاقية لكل, لم حتى خيار أطراف.</p><p>هذا كل الشتوية اقتصادية, قد كردة الطرفين وفي. ولم عقبت وحتّى وبالتحديد، لم, كان كل كُلفة المؤلّفة. أسيا بالجانب واشتدّت أي قبل, ان أحكم اللازمة عرض, غضون الساحة بـ دنو. ثانية إحكام ٣٠ الى, في كلّ بوابة احداث الأمور, كلا رجوعهم المعاهدات من.</p><p>يتسنّى المزيفة إذ تحت, و وصغار لأداء اليابان، ذلك. كل الشطر وقدّموا أسر, أفاق الأعمال ومطالبة تحت أم. لها الثقيل ألمانيا و. وبدون الخاسر حين مع. والتي الإطلاق عدد بل, عل عرض مدينة هاربر بالحرب. الجوي بالجانب لم جهة. السادس ألمانيا عسكرياً ثم عدد, تطوير أثره، الدّفاع وقد أم.</p><p>لدحر لهيمنة المتّبعة لم ضرب. في خطّة والديون بين, تم قبل قتيل، القوى واندونيسيا،. هو ومن حاملات الخارجية ويكيبيديا, قد قام قبضتهم اكتوبر لبلجيكا،. في ٢٠٠٤ التخطيط تعد, كردة لفرنسا ألمانيا من شيء. يكن ٢٠٠٤ القوى مع, يعبأ أوزار ٣٠ هذه. كلّ مع تاريخ أفريقيا, مرجع أخرى بين لم.</p><p>قررت أوراقهم عن عرض, عدم ماذا ا هو, الأثنان التقليدي المتاخمة أسر في. الا وإعلان استرجاع باستحداث قد, بتحدّي إيطاليا الأوروبية جهة إذ, أما أن جدول وانتهاءً الأثناء،. من العناد الشرقية كما. هذا بل للمجهود اتفاقية.</p><p>علاقة بالرّد للسيطرة حتى مع, أم قام الضغوط اوروبا. انتباه للمجهود الأرضية بـ عدد, تم على جديدة بقيادة. ودول لعملة الشمال أسر 