ل، في','<p>لشهير أي حين, أم غضون لتقليعة التكاليف بين, ثانية مدينة قتيل، في</p>','7ea0ff4b7401aab1449196b9faf82703.jpg',1462572000,'no','','','',1461937716,NULL),(41,'تعلم آلة','العلم للحصول على عمل الكمبيوتر','<pre>\r\nتعلم الآلة هو علم من الحصول على أجهزة الكمبيوتر للعمل دون مبرمجة بشكل واضح . في العقد الماضي ، أعطانا تعلم آلة السيارات ذاتية القيادة ، التعرف على الكلام العملي ، البحث على شبكة الإنترنت فعالة ، وفهم تحسنا كبيرا من الجينوم البشري . تعلم الآلة منتشر حتى اليوم أنك ربما استخدامه عشرات المرات في اليوم، دون أن يعرفوا ذلك . ويعتقد كثير من الباحثين أيضا هو أفضل طريقة ل إحراز تقدم نحو المستوى الإنساني لمنظمة العفو الدولية . في هذه الفئة ، وسوف تتعلم حول تقنيات التعلم الآلي الأكثر فعالية ، واكتساب الممارسة تنفيذها، و حملهم على العمل لنفسك. الأهم من ذلك، ستتعرف على الأسس النظرية لل تعلم ليس فقط ، ولكن أيضا اكتساب الدراية العملية اللازمة ل بسرعة و بقوة تطبيق هذه التقنيات ل مشاكل جديدة . وأخيرا ، ستتعرف على بعض من أفضل الممارسات وادي السيليكون في الابتكار لأنها تتعلق تعلم الآلة ، و منظمة العفو الدولية .</pre>','ae2c8d7f09514baef45342d483062085.png',1462226400,'yes','','','',1462257424,NULL);

