insert  into `dah_workshops`(`wid`,`deptid`,`workshop_title`,`workshop_subtitle`,`workshop_content`,`workshop_venue`,`workshop_image`,`from_date`,`to_date`,`workshop_meta_title`,`workshop_meta_keyword`,`workshop_meta_description`,`added_on`,`updated_on`) values (7,2,'نظم الطاقة الشمسية الكهروضوئية والمناطق بانخراطها','التركيز مواد الطاقة الشمسية ونظم','<pre>\r\nالطاقة الشمسية المركزة (CSP) تقنيات استخدام عناصر جمع الضوء على التركيز، وأشعة الشمس المباشرة على الاستقبال، والتي تقوم بتحويل تدفق الطاقة الشمسية للحرارة. ثم يتم استخدام هذه الطاقة الحرارية لإنتاج الكهرباء، عادة عن طريق التوربينات أو حرارة المحرك. من خلال الاستفادة من الحرارة ومدخلات الطاقة، الطاقة الشمسية المركزة مكمل لأشكال أخرى من توليد الطاقة المتجددة التي تعتمد على مصادر الطاقة المتقطعة (مثل وحدات الطاقة الشمسية وطاقة الرياح) وذلك بسبب السهولة النسبية في تخزين الطاقة الحرارية. تخزين الطاقة الحرارية (TES) يمكن بسهولة أن تدمج في محطة الطاقة الشمسية المركزة، والطاقة الشمسية هي فريدة من نوعها بين تكنولوجيات الطاقة المتجددة في أن اندماج تخزين الطاقة يقلل في الواقع تكلفة Levelized الكهرباء (LCOE) من محطة الطاقة الشمسية المركزة، تصل إلى عامل قدرة ما يقرب من 70٪. زيادة النتائج الفعالية من حيث التكلفة من استخدام أفضل للكتلة السلطة لأكثر من ساعة من السنة، والقدرة على تسخير الطاقة الزائدة من مجال الطاقة الشمسية. مستويات أعلى من إنتاج الطاقة والقدرة على تحويل إنتاج الطاقة ليتزامن مع أفضل أحمال الذروة يعادل زيادة في الإيرادات. وهكذا، فإن تكاليف صغيرة نسبيا يرتبط مع نظام TES مصممة تصميما جيدا يمكن أن يعوض إلى حد كبير من قبل تحسن الأداء من محطة الطاقة الشمسية المركزة.</pre>','المملكة العربية السعودية',NULL,1471298400,1475532000,'','','',1462181840,1462259346),(8,2,'تطبيقات إلكترونيات القوى للطاقة المتجددة','تطبيق إلكترونيات القوى أجهزة','<pre>\r\nالاستهلاك العالمي من الطاقة الكهربائية و stillrising و هناك طلب لمضاعفة سعة الطاقة within20 سنوات . وينبغي أيضا أن يتم تعيين إنتاج وتوزيع و استخدام shouldbe الطاقة و كفاءة تكنولوجية ممكن والحوافز ل saveenergy على المستخدم في نهاية المطاف . على مدى التقدم lastdecades في أشباه الموصلات السلطة لديها pavedthe الطريق ل المعدات المبتكرة مثل transmissionlines HVDC أو أجهزة حقائق . وهكذا ، powerconversion القائم على أشباه الموصلات يمثل تقنية تمكن الرئيسية لتلبية thechallenges من\r\nelectricit الغد\r\nالعرض ذ . في هذه الورقة ، وسيتم التحقيق powersemiconductors فيما يتعلق أنظمة الطاقة المتجددة utilizationin . هذه الورقة أيضا مناقشة بعض themost مصادر الطاقة المتجددة الناشئة ، وطاقة الرياح ، microturbine ، وخلايا الوقود و الطاقة الشمسية، التي عن طريق الالكترونيات والكهرباء تتغير من كونها sourcesto الطاقة الصغيرة أن يتصرف مصادر الطاقة الهامة كما هو الحال في نظام الطاقة</pre>','الإمارات العربية المتحدة',NULL,1465941600,1468965600,'','','',1462181856,1462259078),(9,4,'الفرص في التعليم العالي','مكوك الفضاء الحرارية البلاط واقية و البطانيات المتوفرة للاستخدام التعليمية','<pre dir=\"ltr\">\r\nتدعو وكالة ناسا الم<img alt=\"heart\" src=\"http://192.168.36.37:8080/dah/web/assets/js/ckeditor/plugins/smiley/images/heart.png\" style=\"height:23px; width:23px\" title=\"heart\" /><img alt=\"angel\" src=\"http://192.168.36.37:8080/dah/web/assets/js/ckeditor/plugins/smiley/images/angel_smile.png\" style=\"height:23px; width:23px\" title=\"angel\" /><img alt=\"frown\" src=\"http://192.168.36.37:8080/dah/web/assets/js/ckeditor/plugins/smiley/images/confused_smile.png\" style=\"height:23px; width:23px\" title=\"frown\" />ؤهلة المؤسسات و المتاحف التعليمية الولايات المتحدة لطلب مكوك الفضاء البلاط الحما\r\nية الحرارية، و مكوك الفضاء أغطية واقية من الحرارة و غيرها من البنود الاستثنائية المقدمة على أساس من يأتي أولا ،\r\n يخدم أولا حتى نفاذ الك\r\nمية. المنظمات خصصت سابقا البلاط الحماية الحرارية قد تطلب من ثلاث بلاطات\r\n إضافية . سيكون هناك رسوم الشحن الاسمي التي يجب أن تدفع عبر الإنترنت باستخدام بط\r\nاقات الائتمان .</pre>','الولايات المتحدة',NULL,1462917600,1463436000,'','','',1462181876,1462790442),(23,2,'الاتجاهات الناشئة في مجال التكنولوجيا الخضراء','قضايا والاقتصاد','<pre>\r\nقطاع الصناعات التحويلية هو المفتاح ل تعزيز ونشر التغير التكنولوجي ، والتي بدورها\r\nهو سائق حاسما للقدرة التنافسية والنمو الاقتصادي . لذا التنمية الصناعية لديها\r\nإمكانات كبيرة لتحقيق عدد من الأهداف الاجتماعية بما في ذلك ارتفاع معدلات البطالة والفقر\r\nالقضاء والمساواة بين الجنسين ومعايير العمل و تحسين فرص الحصول على التعليم والرعاية الصحية . بعد أي\r\nالتقدم المحرز في تحقيق هذه الأهداف الاجتماعية ستكون قصيرة الأجل إذا صناع القرار وأصحاب المصلحة\r\nلم تنجح في ضمان النمو الاقتصادي المستدام والتنمية الصناعية ضمن\r\nإطارا صالحا للبيئة.</pre>','البحرين',NULL,1462831200,1462917600,'','','',1462261585,1462789153);

